"pro_function_1080p" : "1.Click into the video editor;
2.Export the edited video with 1080p mode;
3.You can get 1080p video;"

"pro_function_effect" : "1.Click into the video editor;
2.Choose effects;
3.You can add at most 20 effects;"

"pro_function_material" : "1.Click into the theme;
2.Download pro stickers;
3.Click“+”to ues pro stickers;"

"pro_function_reverse" : "1.Click into the video editor;
2.Choose clip edit;
3.Use reverse function;"

"pro_function_shoot" : "1.Click into the shoot;
2.Download pro facial stickers;
3.Click to shoot with pro facial stickers;"

"pro_function_voice" : "1.Click into the video editor;
2.Choose voiceover;
3.Record your voice;
4.Click to change your voice;"

"pro_function_water" : "1.Click into the video editor;
2.Export the edited video;
3.You can get the video without watermark;"
